const tintColorLight = "#2f95dc";
const tintColorDark = "#fff";

export default {
	light: {
		text: "#000",
		background: "#fff",
		tint: tintColorLight,
		tabIconDefault: "#ccc",
		tabIconSelected: tintColorLight,
		textInput: "#E9E9EF"
	},
	dark: {
		text: "#fff",
		background: "#000",
		tint: tintColorDark,
		tabIconDefault: "#ccc",
		tabIconSelected: tintColorDark,
		textInput: "#333"
	},
};
